package main

import (
	"fmt"
)

func longestPalindrome(s string) string {
	maxStr := ""
	le := len(s)
	for i := 0; i < le && le-i+1 > len(maxStr); i++ {
		for j := le - 1; j >= i && j-i+1 > len(maxStr); j-- {
			str1 := s[i : j+1]
			isPali := true
			end := len(str1) - 1
			for m := 0; m <= len(str1)/2; m++ {
				if string(str1[m]) != string(str1[end-m]) {
					isPali = false
					break
				}
			}
			if isPali && len(str1) > len(maxStr) {
				maxStr = str1
			}
		}
	}
	return maxStr
}

func main() {
	res := longestPalindrome("")
	fmt.Println(res)
}
